        id
      }
    }
  }
}

query IntrospectionQuery {
  links {
    queryType { name }
    types {
      name
      kind
      fields {
        name
        type {
          name
          kind
        }
      }
    }
  }
}

query {
  links(name: "Link") {
    fields {
      name
      type {
        name
      }
    }
  }
  links {
    __typename
    items {
      __typename
    }
  }
}
